INSERT INTO public.item_item (id, name, description, size, options, quantity, price, category_id_id, image, slug, amazon_id, color, thumbnail_image, brand) VALUES (383, 'Levi''s Mens Men''s 505 Regular Dark Stonewash Jeans', 'The classic Levi''s® look that''s always in style. 505® jeans fit comfortably straight through the seat, thigh and leg. Straight-cut waistband sits at the waist. Sits evenly on both the front and back. Classic, five-pocket design. Branding-stamped rivet and shank button-detailing. "Levi''s®" or trademark-branded red tab at back pocket. Leather brand patch at back waist. Signature arcuate stitch at back pockets. Belt loop waistband. Zip fly and button closure. 100% cotton except on noted washes. Goldentop: 99% cotton, 1% elastane. Skunk Train: 99.13% cotton, 0.87% elastane. Big Root, Cash, Navarro: 98% cotton, 2% elastane. Green Leaf: 93% cotton, 6% polyester, 1% elastane. Machine wash cold, tumble dry low. Imported. Measurements: Waist Measurement: 32 in Outseam: 41 in Inseam: 32 in Front Rise: 11 in Back Rise: 14 in Leg Opening: 16 1⁄2 in Product measurements were taken using size 33, inseam 32. Please note that measurements may vary by size.', null, null, 11, 39, 6, '41mePbP26kL.jpg', 'levis-mens-mens-505-regular-dark-stonewash-jeans', 'B003YUY74S', 'Dark Stonewash', null, null);
