INSERT INTO public.item_item (id, name, description, size, options, quantity, price, category_id_id, image, slug, amazon_id, color, thumbnail_image, brand) VALUES (303, 'The North Face Men''s Thermoball Full Zip Jacket (Small, Falcon Brown)', 'Lofty yet packable, this versatile mid-weight layer will help you take unpredictable mountain weather in your stride. ThermoballTM insulation provides unwavering warmth even when wet - ideal for winter adventures - and allows you to effortlessly compress the jacket into its own pocket for agile travel. A light, durable ripstop shell withstands the rigors of rugged terrain, so you can turn to this piece time and time again. When the intensity peaks, unzip the jacket and let in a cool blast of air. The North Face Thermoball Jacket The North Face Thermoball Jacket is made with a Ripstop shell which can withstand rugged terrain and rough weather conditions to keep you safe and warm without having to worry. Synthetic insulation has been used to fill the jacket which helps to reduce heat loss and increases warmth, even when faced in colder weather conditions. ThermoBall insulation used in the jacket provides the wearer with supreme heat even when the jacket is wet which makes this piece ideal for even the rough winter weather conditions. The jacket can be packed away into its own pocket for light and convenient storage. The hand pockets have been made with zippers to keep your essential items safe and secure on the go. An adjustable cord around the hem allows for a comfortable and personal fit. Elasticated cuffs at the end of each sleeve allow for a secure fit and work as a fantastic way of keeping the weather from getting up the sleeve and into the jacket. The jacket is also media compatible for those of us who like to listen to music or use other gadgets when on the move.', null, null, 9, 165, 5, '51CKREzf8mL.jpg', 'the-north-face-mens-thermoball-full-zip-jacket-small-falcon-brown', 'B01HR0XPQG', 'Falcon Brown', null, null);
INSERT INTO public.item_item (id, name, description, size, options, quantity, price, category_id_id, image, slug, amazon_id, color, thumbnail_image, brand) VALUES (304, 'The North Face Men''s Venture Jacket TNF Black/TNF Black LG', 'Ready for back country storms or everyday excursions, this waterproof, windproof hooded men''s jacket is designed to protect you from rain, year round. The breathable Dryventâ"¢ 2.5L soft-shell exterior is finished with a dry-touch coating that eliminates the need for a mesh lining. WATERPROOF: Impenetrable moisture barrier to guarantee dryness. PACKABLE/STOWABLE: Highly-compressible layer for emergency use or travel. WIND PROTECTION: Limiting air penetration reduces the windchill factor.', null, null, 14, 92, 5, '415yuPXXSEL.jpg', 'the-north-face-mens-venture-jacket-tnf-blacktnf-black-lg', 'B00DGF8N78', 'Tnf Black/Tnf Black', null, null);
